contracts/FlashLoanArbitrage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@aave/core-v3/contracts/flashloan/base/FlashLoanSimpleReceiverBase.sol";
import "@aave/core-v3/contracts/interfaces/IPoolAddressesProvider.sol";
import "./SwapHelper.sol";

interface IUniswapV2Router {
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
}

interface IUniswapV3Router {
    struct ExactInputParams {
        bytes path;
        address recipient;
        uint256 deadline;
        uint256 amountIn;
        uint256 amountOutMinimum;
    }

    function exactInput(ExactInputParams calldata params) external payable returns (uint256 amountOut);
}

interface IMaverickRouter {
    function exactInput(
        bytes calldata path,
        address recipient,
        uint256 deadline,
        uint256 amountIn,
        uint256 amountOutMinimum
    ) external returns (uint256 amountOut);
}

contract FlashLoanArbitrage is 
    Initializable, 
    UUPSUpgradeable, 
    OwnableUpgradeable, 
    ReentrancyGuardUpgradeable,
    FlashLoanSimpleReceiverBase 
{
    using SafeERC20 for IERC20;
    using SwapHelper for *;

    // Events
    event FlashLoanExecuted(address token, uint256 amount);
    event ArbitrageExecuted(address[] path, uint256 profit);
    event EmergencyWithdraw(address token, uint256 amount);
    event DexRouterUpdated(string indexed dex, address router);
    event StrategyUpdated(string strategyType, bytes strategyData);
    event ProfitThresholdUpdated(uint256 newThreshold);

    // Constants for Base mainnet
    address public constant WETH = 0x4200000000000000000000000000000000000006;

    // DEX Types
    enum DexType { UniswapV2, UniswapV3, Maverick }

    // DEX Configuration
    struct DexConfig {
        address router;
        DexType dexType;
        uint24[] feeTiers;
        bool enabled;
        bool isStablePair;
    }

    // Configurable parameters
    uint256 public minProfitThreshold;  // Minimum profit threshold
    uint256 public maxSlippage;         // Maximum allowed slippage

    // Supported DEX routers
    mapping(string => DexConfig) public dexConfigs;

    // Strategy storage
    mapping(bytes32 => bytes) public strategies;

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor(address _addressProvider) 
        FlashLoanSimpleReceiverBase(IPoolAddressesProvider(_addressProvider)) 
    {
        _disableInitializers();
    }

    function initialize(
        address initialOwner,
        uint256 _minProfitThreshold,
        uint256 _maxSlippage
    ) public initializer {
        __Ownable_init();
        _transferOwnership(initialOwner);
        __ReentrancyGuard_init();
        __UUPSUpgradeable_init();

        minProfitThreshold = _minProfitThreshold;
        maxSlippage = _maxSlippage;

        // Initialize DEX configurations
        uint24[] memory uniV3Fees = new uint24[](4);
        uniV3Fees[0] = 100;
        uniV3Fees[1] = 500;
        uniV3Fees[2] = 3000;
        uniV3Fees[3] = 10000;

        dexConfigs["uniswap"] = DexConfig({
            router: 0x2626664c2603336E57B271c5C0b26F421741e481,
            dexType: DexType.UniswapV3,
            feeTiers: uniV3Fees,
            enabled: true,
            isStablePair: false
        });

        uint24[] memory emptyFees = new uint24[](0);

        dexConfigs["sushiswap"] = DexConfig({
            router: 0x8a742C6907Ea9Ad400953744F201B319b4c398a4,
            dexType: DexType.UniswapV2,
            feeTiers: emptyFees,
            enabled: true,
            isStablePair: false
        });

        dexConfigs["baseswap"] = DexConfig({
            router: 0x327Df1E6de05895d2ab08513aaDD9313Fe505d86,
            dexType: DexType.UniswapV2,
            feeTiers: emptyFees,
            enabled: true,
            isStablePair: false
