    /**
     * @dev Required by the OZ UUPS module
     */
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    /**
     * @dev Execute swap based on DEX type
     */
    function _executeSwap(
        string memory dex,
        address tokenIn,
        address tokenOut,
        uint256 amountIn,
        uint256 amountOutMin,
        bytes memory /* swapData */
    ) internal returns (uint256) {
        DexConfig memory config = dexConfigs[dex];
        require(config.enabled, "DEX not enabled");

        // Prepare path
        address[] memory path = new address[](2);
        path[0] = tokenIn;
        path[1] = tokenOut;

        bytes memory encodedData;
        uint256 deadline = block.timestamp + 300; // 5 minutes deadline

        if (config.dexType == DexType.UniswapV2) {
            if (keccak256(bytes(dex)) == keccak256(bytes("sushiswap"))) {
                encodedData = SwapHelper.encodeSushiSwap(path, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("baseswap"))) {
                encodedData = SwapHelper.encodeBaseSwap(path, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("alienbase"))) {
                encodedData = SwapHelper.encodeAlienBaseSwap(path, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("swapbased"))) {
                encodedData = SwapHelper.encodeSwapBasedSwap(path, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("aerodrome"))) {
                encodedData = SwapHelper.encodeAerodromeSwap(path, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("synthswap"))) {
                encodedData = SwapHelper.encodeSynthSwap(path, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("horizondex"))) {
                encodedData = SwapHelper.encodeHorizonDEXSwap(path, amountIn, amountOutMin, address(this), deadline);
            }
        } else if (config.dexType == DexType.UniswapV3) {
            uint24 feeTier = SwapHelper.getOptimalFeeTier(tokenIn, tokenOut, config.isStablePair);
            uint24[] memory fees = new uint24[](1);
            fees[0] = feeTier;

            if (keccak256(bytes(dex)) == keccak256(bytes("uniswap"))) {
                encodedData = SwapHelper.encodeUniswapV3Swap(path, fees, amountIn, amountOutMin, address(this), deadline);
            } else if (keccak256(bytes(dex)) == keccak256(bytes("pancakeswap"))) {
                encodedData = SwapHelper.encodePancakeSwap(path, fees, amountIn, amountOutMin, address(this), deadline, true);
            }
        } else if (config.dexType == DexType.Maverick) {
            uint24 feeTier = SwapHelper.getOptimalFeeTier(tokenIn, tokenOut, config.isStablePair);
            uint24[] memory fees = new uint24[](1);
            fees[0] = feeTier;
            encodedData = SwapHelper.encodeMaverickSwap(path, fees, amountIn, amountOutMin, address(this), deadline);
        }

        // Execute the swap
        (bool success, bytes memory result) = config.router.call(encodedData);
        require(success, "Swap failed");

        return abi.decode(result, (uint256));
    }

    /**
     * @dev This function is called after your contract has received the flash loaned amount
     */
    function executeOperation(
        address asset,
        uint256 amount,
        uint256 premium,
        address,  // initiator
        bytes calldata params
    ) external override returns (bool) {
        ArbitrageParams memory arbitrageParams = _decodeParams(params);

        // Track initial balance
        uint256 initialBalance = IERC20(asset).balanceOf(address(this));
        uint256 currentAmount = amount;

        // Execute arbitrage swaps
        for (uint i = 0; i < arbitrageParams.path.length - 1; i++) {
            IERC20(arbitrageParams.path[i]).safeApprove(dexConfigs[arbitrageParams.dexes[i]].router, 0);
            IERC20(arbitrageParams.path[i]).safeApprove(dexConfigs[arbitrageParams.dexes[i]].router, currentAmount);

            currentAmount = _executeSwap(
                arbitrageParams.dexes[i],
                arbitrageParams.path[i],
                arbitrageParams.path[i + 1],
                currentAmount,
                arbitrageParams.amountsOutMin[i],
                arbitrageParams.swapData[i]
            );
        }

        // Calculate profit
        uint256 finalBalance = IERC20(asset).balanceOf(address(this));
        require(finalBalance >= initialBalance + premium, "Insufficient profit");
        require(
            finalBalance >= initialBalance + (initialBalance * minProfitThreshold) / 1e18,
            "Profit below threshold"
        );

        // Approve repayment
        IERC20(asset).safeApprove(address(POOL), amount + premium);

        emit ArbitrageExecuted(arbitrageParams.path, finalBalance - initialBalance - premium);
        return true;
    }

    struct ArbitrageParams {
        string[] dexes;
        address[] path;
        uint256[] amountsOutMin;
        bytes[] swapData;
    }

    function _decodeParams(bytes memory params) internal pure returns (ArbitrageParams memory) {
        (
            string[] memory dexes,
            address[] memory path,
            uint256[] memory amountsOutMin,
            bytes[] memory swapData
        ) = abi.decode(params, (string[], address[], uint256[], bytes[]));

        return ArbitrageParams({
            dexes: dexes,
            path: path,
            amountsOutMin: amountsOutMin,
            swapData: swapData
        });
    }

    /**
     * @dev Initiates a flash loan arbitrage
     */
    function executeArbitrage(
        address asset,
        uint256 amount,
        string[] calldata dexes,
        address[] calldata path,
        uint256[] calldata amountsOutMin,
        bytes[] calldata swapData
    ) external onlyOwner nonReentrant {
        require(path.length > 1, "Invalid path length");
        require(path[0] == path[path.length - 1], "Invalid arbitrage path");
        require(dexes.length == path.length - 1, "Invalid dexes length");
        require(amountsOutMin.length == path.length - 1, "Invalid amountsOutMin length");
        require(swapData.length == path.length - 1, "Invalid swapData length");

        bytes memory params = abi.encode(dexes, path, amountsOutMin, swapData);
        POOL.flashLoanSimple(address(this), asset, amount, params, 0);

        emit FlashLoanExecuted(asset, amount);
    }

    /**
     * @dev Updates a DEX configuration
     */
    function updateDexConfig(
        string calldata dex,
        address router,
        DexType dexType,
        uint24[] calldata feeTiers,
        bool enabled,
        bool isStablePair
    ) external onlyOwner {
        require(router != address(0), "Invalid router address");
        dexConfigs[dex] = DexConfig({
            router: router,
            dexType: dexType,
            feeTiers: feeTiers,
            enabled: enabled,
            isStablePair: isStablePair
        });
        emit DexRouterUpdated(dex, router);
    }

    /**
     * @dev Updates the minimum profit threshold
     */
    function updateProfitThreshold(uint256 _minProfitThreshold) external onlyOwner {
        minProfitThreshold = _minProfitThreshold;
        emit ProfitThresholdUpdated(_minProfitThreshold);
    }

    /**
     * @dev Stores a new arbitrage strategy
     */
    function setStrategy(
        string calldata strategyType,
        bytes calldata strategyData
    ) external onlyOwner {
        bytes32 strategyHash = keccak256(abi.encodePacked(strategyType));
        strategies[strategyHash] = strategyData;
        emit StrategyUpdated(strategyType, strategyData);
    }

    /**
     * @dev Emergency withdrawal of stuck funds
     */
    function emergencyWithdraw(address token) external onlyOwner {
        uint256 balance = IERC20(token).balanceOf(address(this));
        require(balance > 0, "No balance to withdraw");

        IERC20(token).safeTransfer(owner(), balance);
        emit EmergencyWithdraw(token, balance);
    }

    /**
     * @dev Receive function to accept ETH
     */
    receive() external payable {}
}

